import React , {useState} from 'react';
import FilterGallery from './FilterGallery';





function Games_Page(){

    const [Gclick , SetGclick] = useState(null);

    function Weapons(){
        SetGclick(FilterGallery);
    }

    return(
        <>
            <div className='button-container'>
                <button onClick={Weapons} className='btn btn-danger my-5 mx-5 p-3'>Get Weapon NFT</button>
                <button className='btn btn-danger my-5 mx-5 p-3'>Get Armour NFT</button>
            </div>

            {Gclick}

        </>
    )
}

export default Games_Page;
